import React, { Component } from 'react'
import "../components/style/header.scss"

export default class Headers extends Component {
    constructor(props){
        super(props)
        this.state=({
            status: true,
        })
    }

    render() {
        return (

            <div className="header_bar">
              <div className="header_bar_left">
                <a href="#logo"><img src="images/logo.svg" alt="hello" /></a>
                <a href="#">Features</a>
                <a href="#">Pricing</a>
                <a href="#">Resources</a>
              </div>
              <div className="header_bar_right">
                <div className="div"><button>Login</button></div>
                <div className="div"><button>Logout</button></div>

              </div>
              <div className="menu"><img src="images/icons8-menu.svg" alt="" onClick={this.set} />

              </div>
            </div>
        )
    }
}
